import React from 'react';
import Card from '@components/Card';
const card = [
    { 'title': 'نمایشگاه', id: 1 },
    { 'title': 'جستجوی پیشرفته', id: 2 },
    { 'title': 'افزودن اگهی', id: 3 },
    { 'title': 'صفحه ی شما', id: 4 },
];
const car = [
    { img: '', model: 2021, km: 53, city: 'زنجان', price: '45,000,000' },
    { img: '', model: 2021, km: 53, city: 'بابل', price: '45,000,000' },
    { img: '', model: 2021, km: 53, city: 'سهرورد', price: '45,000,000' },
    { img: '', model: 2021, km: 53, city: 'تهران', price: '45,000,000' },
    { img: '', model: 2021, km: 53, city: 'مازندران', price: '45,000,000' },
    { img: '', model: 2021, km: 53, city: 'رشت', price: '45,000,000' },
    { img: '', model: 2021, km: 53, city: 'کرج', price: '45,000,000' },
    { img: '', model: 2021, km: 53, city: 'قیدار', price: '45,000,000' },
    { img: '', model: 2021, km: 53, city: 'قیدار', price: '45,000,000' },
];

export default function index() {
    return (
        <div>
            <div className="relative px-36">
                <div className="">
                    <div className=" mt-32 flex justify-center items-center">
                        {card.map((item) => (
                            <div className="" key={item.id}>
                                <div className="bg-green-500 w-48 h-24 rounded-2xl flex justify-center items-center mr-10 text-sm">
                                    <p>{item.title}</p>
                                </div>
                            </div>
                        ))}
                    </div>
                </div>
            </div>
            <div className="mt-20">
                <Card data={car} />
            </div>
        </div>
    );
}
